/*Table structure for table `tlistacol` */

DROP TABLE IF EXISTS `tlistacol`;

CREATE TABLE `tlistacol` (
  `IdColab` int(50) NOT NULL COMMENT 'Identificacion Colaborador',
  `NombCol` varchar(255) DEFAULT NULL COMMENT 'Nombre Colaborador',
  `CarCol` varchar(255) DEFAULT NULL,
  `FeInCol` date DEFAULT NULL COMMENT 'fecha ingreso',
  `FeReCol` date DEFAULT NULL COMMENT 'fecha retiro',
  `CodCol` int(5) DEFAULT NULL,
  `ContCol` varchar(30) DEFAULT NULL,
  `DepCol` varchar(255) DEFAULT NULL,
  `TodCampos` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`IdColab`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

